ary '\0',NULL,'images/Screen_Shot_2021-07-26_at_21.49.26162740812958863853.png','DRAFT','user','2021-07-27 17:49:22.862','user','2021-07-27 17:49:22.862',_binary '\0'),(1093,124,1,'Front end vs back end developer salary','Which job title has a higher salary: a front end developer or back end developer?','<p style=\"margin-left:0px;\">When comparing front end vs back end developer salary, the question is back end developer a higher paid career path?</p><p style=\"margin-left:0px;\">According to some sources, the difference is as little as 1%, while other sources (such as Glassdoor) suggest that back end engineers can earn even <strong>25% more</strong> than front end developers! There is definitely a pattern suggesting that back end software development comes with higher salaries.</p>',_binary '\0',NULL,'images/unnamed16276545230403368.jpg','NORMAL','user917','2021-07-30 14:15:32.180','user917','2021-07-30 14:15:32.180',_binary '\0'),(1094,1,1,'Tm hiu MYSQL Architecture','n vi thng 4, thng ca nhng li ni di','<h2 style=\"margin-left:0px;\"><strong>M u</strong></h2><p>n vi thng 4, thng ca nhng li ni di. Th ti s a cc bn i tm v mt s tht th v.  l s tht v kin trc ca mysql. Mt h qun tr c s d liu quan h m ngun m (RDBMS) ph bin nht hin nay.</p><h2 style=\"margin-left:0px;\"><strong>Major components &amp; Layer</strong></h2><p>MYSQL Architecture m t cch m nhng component trong mysql tng tc vi nhau. V c bn th MYSQL Architecture l mt h thng client - server system. Vi Client l ch cc ng dng kt ni ti My ch c s d liu MySQL. V server system chnh l My ch c s d liu MySQL. MYSQL Architecture s bao gm cc thnh phn chnh sau:</p><figure class=\"image\"><img src=\"https://images.viblo.asia/a50cffe7-bf45-4da4-99a7-d7b7e605256b.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/a50cffe7-bf45-4da4-99a7-d7b7e605256b.png 2x\" sizes=\"100vw\"></figure><p> khi qut hn th ti xin chia MYSQL Architecture thnh 3 layer chnh bao gm :</p><p>Application Layer (layer 1)</p><p>MySQL Server layer (layer 2)</p><p>Storage Engine Layer (layer 3)</p><figure class=\"image\"><img src=\"https://images.viblo.asia/737c9d67-99e6-4e7a-9756-16532759cdf3.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/737c9d67-99e6-4e7a-9756-16532759cdf3.png 2x\" sizes=\"100vw\"></figure><h2 style=\"margin-left:0px;\"><strong>Application Layer</strong></h2><p>Application Layer chnh l lp trn cng nht trong kin trc MySQL. y l ni client v user dng tng tc vi MySQL RDBMS. Mt s dch v c cung cp bn di: <strong>connection handling</strong>, <strong>authentication</strong>, <strong>security</strong> u c  y. C ba thnh phn chnh trong lp ny l Administrators, Clients, Query Users nh th hin trong hnh bn di.</p><figure class=\"image\"><img src=\"https://images.viblo.asia/717fed47-8adf-4455-959c-8957195f5356.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/717fed47-8adf-4455-959c-8957195f5356.png 2x\" sizes=\"100vw\"></figure><p><strong>Administrators</strong> s dng cc tin ch v giao din qun tr khc nhau nh mysqladmin thc hin cc tc v nh tt my ch v to hoc hy c s d liu, mysqldump  sao lu c s d liu hoc sao chp c s d liu sang mt my ch khc.</p><p><strong>Clients</strong> giao tip vi MySQL thng qua cc giao din v tin ch khc nhau nh MySQL API. MySQL API gi truy vn n my ch di dng mt chui cc m thng bo.</p><p><strong>Query Users</strong> truy vn tng tc vi MySQL RDBMS thng qua giao din truy vn l mysql .</p><h2 style=\"margin-left:0px;\"><strong>Connection handling</strong></h2><p>Khi mt client kt ni vi server, Client s nhn c thread ring cho kt ni ca n. Tt c cc truy vn t client  c thc thi trong thread c ch nh . Thread c lu trong b nh cache ca my ch, v vy chng khng cn phi to v hy mi khi c kt ni mi.</p><p> qun l s kt ni th mysql c cung cp cho ta bin max_connection. C 1 tip nh y chnh l <a href=\"https://dev.mysql.com/doc/refman/8.0/en/mysqld.html\">mysqld</a> cho php max_connections + 1 kt ni Client. Vi iu kin kt ni b sung l cc ti khon c CONNECTION_ADMIN. Bng cch cp c quyn cho administrators , N c th kt ni vi my ch v s dng SHOW PROCESSLIST  chn on s c ngay c khi s lng kt ni t Client  t mc ti a.</p><p>Khi t gi tr ca max_connections chng ta nn cn nhc n mt s yu t sau:</p><p>Cht lng ca thread library trn mt platform nht nh.</p><p>Dung lng RAM c sn.</p><p>Dung lng RAM c s dng cho mi kt ni.</p><p>Khi lng cng vic t mi kt ni.</p><p>Thi gian phn hi mong mun.</p><p>S lng file m t c sn.</p><h2 style=\"margin-left:0px;\"><strong>Authentication</strong></h2><p>Bt c khi no client kt ni vi MySQL server, my ch s thc hin xc thc  pha my ch. Vic xc thc da trn username, password v host ca client.</p><p>V d:</p><pre><code class=\"language-plaintext\">root@localhost root:  username ca Client.\nlocalhost: tn host\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Security</strong></h2><p>Sau khi Client c kt ni thnh cng vi MySQL Server, server s kim tra xem client  c c quyn a ra cc truy vn nht nh i vi my ch MySQL.</p><p>V d:</p><pre><code class=\"language-plaintext\">mysql&gt; show privileges \\G\n*************************** 1. row ***************************\n  Privilege: Alter\n  Context: Tables\n  Comment: To alter the table\n*************************** 2. row ***************************\n  Privilege: Alter routine\n  Context: Functions,Procedures\n  Comment: To alter or drop stored functions/procedures\n</code></pre><h2 style=\"margin-left:0px;\"><strong>MySQL Server layer</strong></h2><p>Lp ny m nht tt c cc chc nng logic ca h thng mysql RDBMS, N cn c v nh b no ca mysql. Lp logic ca MySQL c chia thnh cc thnh phn ph khc nhau, c a ra di y:</p><ul><li>MySQL services and utilities.</li><li>SQL Interface.</li><li>SQL Parser.</li><li>Optimizer.</li><li>Caches.</li></ul><h2 style=\"margin-left:0px;\"><strong>MySQL services and utilities</strong></h2><p>Mysql cung cp nhiu loi dch v v tin ch. y l mt trong nhng l do chnh cho s ph bin ca MySQL. Lp ny cung cp cc dch v v tin ch  qun tr v bo tr h thng MySQL, mt s trong s chng c  cp di y:</p><ul><li>Backup &amp; recovery.</li><li>Security.</li><li>Replication.</li><li>Cluster.</li><li>Partitioning.</li><li>Workbench.</li></ul><h3 style=\"margin-left:0px;\"><strong>Backup &amp; recovery</strong></h3><p>C mt iu quan trng l phi sao lu c s d liu  bn c th khi phc d liu ca mnh v chy li trong trng hp xy ra s c, chng hn nh s c h thng, li phn cng hoc ngi dng xa nhm d liu. Bn sao l cng rt cn thit nh mt bin php bo v trc khi nng cp ci t MySQL v chng c th c s dng  chuyn ci t MySQL sang h thng khc hoc thit lp my ch bn sao.</p><p>V d sao lu bng Command-Line trong mysqldump:</p><pre><code class=\"language-plaintext\">1. Sao lu database trong mysql: \nsudo mysqldump -u [user] -p[database_name] &gt; [filename].sql \n\n2.  sao lu ton b H thng qun l database:\nmysqldump --all-databases --single-transaction --quick --lock-tables=false &gt; full-backup-$(date +%F).sql -u root -p\n</code></pre><h3 style=\"margin-left:0px;\"><strong>Security</strong></h3><p>MySQL s dng bo mt da trn Danh sch kim sot truy cp (ACL) cho tt c cc kt ni, truy vn v cc hot ng khc m ngi dng c th c gng thc hin. Ngoi ra cn c h tr cho cc kt ni c m ha SSL gia my khch v my ch MySQL.</p><p>Khi chy mysql hy lm theo 1 s nguyn tc sau:</p><ul><li>Mt iu quan trong l <strong>ng bao gi cp cho bt k ai</strong> (ngoi tr ti khon root ca MySQL ) <strong>quyn truy cp</strong> vo bng user trong mysql c s d liu h thng!</li><li>Tm hiu cch hot ng ca h thng c quyn truy cp MySQL ( xem chi tit <a href=\"https://dev.mysql.com/doc/mysql-security-excerpt/5.7/en/access-control.html\">ti y</a>). Khng cp nhiu c quyn hn mc cn thit. V khng bao gi cp c quyn cho tt c cc my ch. S dng lnh SHOW GRANTS  kim tra nhng ti khon no c quyn truy cp vo nhng g. Sau , s dng lnh REVOKE  loi b nhng c quyn khng cn thit.</li><li>Khng lu tr mt khu mt cc r rng. Thay vo  hay s dng , hy s dng SHA2() hoc mt s hm hash mt chiu khc v lu tr gi tr hash.</li><li>Thit lp firewall, iu ny bo v bn khi t nht 50% tt c cc loi khai thc trong bt k phn mm no. t MySQL sau firewall hoc trong demilitarized zone (DMZ).</li><li>Cc ng dng ca MYSQL khng c tin tng bt k d liu g m c ngi dng nhp vo. Mi cu lnh phi c m ho thch hp. y cng cch  phng trnh 1 trong nhng tn cng nghim trng v ph bin nht l tn cngsql injection.</li><li>Khng truyn d liu thun ty (khng c m ha) qua Internet. Thng tin ny c th truy cp c i vi tt c nhng ngi c thi gian v kh nng chn n v s dng n cho mc ch ring ca h. Thay vo , hy s dng giao thc c m ha nh SSL hoc SSH. MySQL h tr cc kt ni SSL ni b. Mt k thut khc l s dng chuyn tip cng SSH  to mt ng hm c m ha (v nn) cho giao tip.</li><li>Tm hiu cch s dng cc tin ch <strong>tcpdump</strong> v <strong>strings</strong> .</li></ul><h3 style=\"margin-left:0px;\"><strong>Replication</strong></h3><p>Replication MySQL l mt qu trnh cho php d liu t mt my ch c s d liu MySQL (my ch) c sao chp t ng sang mt hoc nhiu my ch c s d liu MySQL (my ch). Nghe c th hi ging phn <strong>Backup &amp; recovery</strong>. Nhng khng phi Replication thng c s dng  lan truyn quyn truy cp c trn nhiu my ch,  c kh nng m rng. Mc d n cng c th c s dng cho cc mc ch khc nh chuyn i d phng hoc phn tch d liu trn my ch  khng lm qu ti my ch.</p><p>Gii thch 1 cht nh, c 1 nguyn l quan trng trong mysql  l tnh ton vn d liu. V khi nim lock cng sinh ra  m bo nguyn l trn. Nhng cuc sng m, lm g c th g hon ho. Lock cng tn ti kh nhiu nhc im nh: lm gim tc  truy cp, kh scale... n y, Bng Replication ta c th thit k nhng DB phc v nhng chc nng chuyn bit dnh  c, ghi.</p><figure class=\"image\"><img src=\"https://images.viblo.asia/c19e8881-d559-4e79-adb9-2b18b89e8834.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/c19e8881-d559-4e79-adb9-2b18b89e8834.png 2x\" sizes=\"100vw\"></figure><h3 style=\"margin-left:0px;\"><strong>Cluster</strong></h3><p>MySQL Cluster l c s d liu phn tn kt hp kh nng m rng lin tc v tnh sn sng cao. N cung cp truy cp thi gian thc trong b nh vi s nht qun v tin trnh x l trn cc b d liu phn tn v phn vng. N c thit k cho cc ng dng quan trng. MySQL Cluster c bn sao gia cc cm (Cluster) trn nhiu trang web a l c tch hp sn. MySQL Cluster c chng minh hng ngy trong cc h thng phc v hng t ngi dng. N c s dng trong nhim v quan trng, ng dng ct li ca mng in thoi di ng, h thng xc thc v tr chi nn tng vi khi lng d liu bng n v lng ngi dng ti.</p><h3 style=\"margin-left:0px;\"><strong>Partitioning</strong></h3><p>Mysql Partitioning theo ng nh tn ca n l vic phn chia mt table thnh nhng phn nh theo mt logic nht nh, c phn bit bng key, key ny thng l tn column trong table.</p><figure class=\"image\"><img src=\"https://images.viblo.asia/21ea6d0f-5cb9-4076-b4f6-a4d13dc94d6a.png\" alt=\"\" srcset=\"https://images.viblo.asia/retina/21ea6d0f-5cb9-4076-b4f6-a4d13dc94d6a.png 2x\" sizes=\"100vw\"></figure><h3 style=\"margin-left:0px;\"><strong>Workbench</strong></h3><p>MySQL Workbench l mt cng c trc quan hp nht dnh cho database architects, developer v DBA. MySQL Workbench cung cp data modeling, SQL development v cc cng c qun tr ton din  cu hnh my ch, qun tr ngi dng, sao lu v hn th na. MySQL Workbench c sn trn Windows, Linux v Mac OS.</p><h2 style=\"margin-left:0px;\"><strong>SQL Interface</strong></h2><p>Structured Query Language (SQL) l mt ngn ng truy vn, c s dng  truy vn my ch MySQL. N l mt cng c  tng tc gia ngi dng my khch MySQL v my ch. Mt s thnh phn SQL Interface :</p><ul><li>Data Manipulation Language (DML).</li><li>Data Definition Language (DDL).</li><li>Stored Procedures.</li><li>Views.</li><li>Triggers.</li></ul><h2 style=\"margin-left:0px;\"><strong>Parser</strong></h2><p>My ch MySQL nhn cc truy vn  nh dng SQL. Sau khi nhn c mt truy vn, trc tin n cn c phn tch c php. Qu trnh ny c gi tt l Parser. MySQL phn tch c php cc truy vn  to cu trc bn trong (Parser tree). MySQL parser hot ng nh mt trnh bin dch truyn n. Theo ni b MySQL, cu trc trnh phn tch c php c a ra bn di.</p><ul><li>Lexical analysis (phn tch t vng):  gian on ny cc cu truy vn s c chia thnh cc tokens v cc thnh phn khng th chia (v d nh tn ct, tn bng,..). y cng l giai on u tin ca qu trnh.</li><li>Syntactic analysis (phn tch c php): phn tch ng ngha (m bo rng nhng cu ny c  ngha) v to code (cho trnh bin dch) . Tt c chng u c thc hin cng mt lc, trong giai on code.</li></ul><p>Cui cng, mt Parser tree c to ra, by gi l cng vic ca Optimizer.</p><h2 style=\"margin-left:0px;\"><strong>Optimizer</strong></h2><p>Sau khi to Parser tree ni b, MySQL p dng nhiu k thut ti u ha khc nhau. Cc k thut ny c th bao gm, vit li truy vn, th t qut cc bng v chn cc index ph hp  s dng. Trn thc t, bn c th yu cu my ch gii thch cc kha cnh khc nhau ca vic ti u ha. V d:</p><pre><code class=\"language-plaintext\">EXPLAIN SELECT * FROM users;\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Caches</strong></h2><p>MySQL cache (b m truy vn) lu tr cc b kt qu hon chnh cho cc cu lnh SELECT . Trc khi Parser truy vn, my ch MySQL tham kho b m truy vn. Nu bt k client no a ra mt truy vn ging ht vi mt truy vn  c trong b nh cache, my ch ch cn b qua parser, optimizer v thm ch l thc thi, n ch n gin l hin th u ra t b nh cache.</p><p>MySQL cache c th hu ch trong mi trng m bn c cc bng khng thng xuyn thay i v my ch nhn c nhiu truy vn ging nhau.</p><p>Mt s lu  khi s dng MySQL cache:</p><ul><li>MySQL cache khng c chp nhn k t MySQL 5.7.20 v b xa trong MySQL 8.0.</li><li>MySQL cache khng hot ng trong mi trng m bn c nhiu my ch mysqld cp nht cc MyISAM bng ging nhau .</li><li>MySQL cache khng c h tr cho cc partitioned table v t ng b v hiu ha cho cc truy vn lin quan n cc partitioned table.</li></ul><h2 style=\"margin-left:0px;\"><strong>Storage Engine Layer</strong></h2><p>Tnh nng Storage Engine c th cm c lm cho MySQL tr thnh la chn c nht v a thch ca hu ht cc developer. MySQL cho php chng ta la chn cc cng c lu tr khc nhau cho cc tnh hung v yu cu khc nhau. Danh sch cc cng c lu tr c h tr c  cp bn di.</p><ul><li>MyISAM.</li><li>InnoDB.</li><li>Federated.</li><li>Mrg_MyISAM.</li><li>Blackhole.</li><li>CSV.</li><li>Memory.</li><li>Archive.</li><li>Performance_schema.</li></ul><p>MySQL cung cp iu ny nh mt cng c lu tr c th cm c, cc cng c lu tr khc nhau c th c s dng  cp bng. Lnh Show engine s lit k tt c cc cng c lu tr c h tr bi my ch ca bn.</p><pre><code class=\"language-plaintext\">mysql&gt; SHOW ENGINES;\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Kt lun</strong></h2><p>Vi vn kin thc hn hp ca mnh mnh  m t s lc v m hnh kin trc ca mysql. Mong qua bi vit ny cc bn c th hiu thm v cch m mysql t chc cng nh cc thnh phn chnh to nn 1 h thng qun l d mysql. Link tham kho: <a href=\"https://www.rathishkumar.in/2016/04/understanding-mysql-architecture.html\">https://www.rathishkumar.in/2016/04/understanding-mysql-architecture.html</a></p><p><a href=\"https://dev.mysql.com/doc\">https://dev.mysql.com/doc</a></p><p><a href=\"https://www.toptal.com/mysql/mysql-master-slave-replication-tutorial#:~:text=MySQL%20replication%20is%20a%20process,database%20servers%20(the%20slaves).&amp;text=However%2C%20general%20principles%20of%20setting,same%20for%20all%20operating%20systems\">https://www.toptal.com/mysql/mysql-master-slave-replication-tutorial#:~:text=MySQL replication is a process,database servers (the slaves).&amp;text=However%2C general principles of setting,same for all operating systems</a>.</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 14:42:58.092','user','2021-07-31 14:42:58.092',_binary '\0'),(1096,124,1,'8 Tips To Become A Better Front End Developer','Should I use this plugin or that library? Should I plan this project or dive straight into coding? Should I ask for help or figure it out myself?','<h4 style=\"margin-left:0px;\">1. Plan your projects</h4><h4 style=\"margin-left:0px;\">2. Be Proactive</h4><h4 style=\"margin-left:0px;\">3. Be curious</h4><h4 style=\"margin-left:0px;\">4. Invest in your skills</h4><h4 style=\"margin-left:0px;\">5. Dont say YES to everything</h4><h4 style=\"margin-left:0px;\">6. Dont say NO to everything</h4><h4 style=\"margin-left:0px;\">7. Find a mentor</h4><h4 style=\"margin-left:0px;\">8. Stay active</h4>',_binary '\0',NULL,'images/img_projects162774285448579527.png','NORMAL','user917','2021-07-31 14:47:39.425','user917','2021-07-31 14:47:39.425',_binary '\0'),(1097,124,1,'Why to Learn java Programming?','Java is a high-level programming language originally developed by Sun Microsystems and released in 1995','<p style=\"margin-left:0.2em;text-align:justify;\">Java is a MUST for students and working professionals to become a great Software Engineer specially when they are working in Software Development Domain. I will list down some of the key advantages of learning Java Programming:</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Object Oriented</strong>  In Java, everything is an Object. Java can be easily extended since it is based on the Object model.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Platform Independent</strong>  Unlike many other programming languages including C and C++, when Java is compiled, it is not compiled into platform specific machine, rather into platform independent byte code. This byte code is distributed over the web and interpreted by the Virtual Machine (JVM) on whichever platform it is being run on.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Simple</strong>  Java is designed to be easy to learn. If you understand the basic concept of OOP Java, it would be easy to master.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Secure</strong>  With Java\'s secure feature it enables to develop virus-free, tamper-free systems. Authentication techniques are based on public-key encryption.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Architecture-neutral</strong>  Java compiler generates an architecture-neutral object file format, which makes the compiled code executable on many processors, with the presence of Java runtime system.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Portable</strong>  Being architecture-neutral and having no implementation dependent aspects of the specification makes Java portable. Compiler in Java is written in ANSI C with a clean portability boundary, which is a POSIX subset.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Robust</strong>  Java makes an effort to eliminate error prone situations by emphasizing mainly on compile time error checking and runtime checking.</p><h2>Hello World using Java Programming.</h2><p style=\"margin-left:0.2em;text-align:justify;\">Just to give you a little excitement about Java programming, I\'m going to give you a small conventional C Programming Hello World program, You can try it using Demo link.</p><p><a href=\"http://tpcg.io/JFXzYe\">Live Demo</a>public class MyFirstJavaProgram {\n\n &nbsp; /* This is my first java program.\n &nbsp; &nbsp;* This will print \'Hello World\' as the output\n &nbsp; &nbsp;*/\n\n &nbsp; public static void main(String []args) {\n &nbsp; &nbsp; &nbsp;System.out.println(\"Hello World\"); // prints Hello World\n &nbsp; }\n}</p><h2>Applications of Java Programming</h2><p style=\"margin-left:0.2em;text-align:justify;\">The latest release of the Java Standard Edition is Java SE 8. With the advancement of Java and its widespread popularity, multiple configurations were built to suit various types of platforms. For example: J2EE for Enterprise Applications, J2ME for Mobile Applications.</p><p style=\"margin-left:0.2em;text-align:justify;\">The new J2 versions were renamed as Java SE, Java EE, and Java ME respectively. Java is guaranteed to be <strong>Write Once, Run Anywhere.</strong></p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Multithreaded</strong>  With Java\'s multithreaded feature it is possible to write programs that can perform many tasks simultaneously. This design feature allows the developers to construct interactive applications that can run smoothly.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Interpreted</strong>  Java byte code is translated on the fly to native machine instructions and is not stored anywhere. The development process is more rapid and analytical since the linking is an incremental and light-weight process.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>High Performance</strong>  With the use of Just-In-Time compilers, Java enables high performance.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Distributed</strong>  Java is designed for the distributed environment of the internet.</p><p style=\"margin-left:0.2em;text-align:justify;\"><strong>Dynamic</strong>  Java is considered to be more dynamic than C or C++ since it is designed to adapt to an evolving environment. Java programs can carry extensive amount of run-time information that can be used to verify and resolve accesses to objects on run-time.</p><h2>Audience</h2><p style=\"margin-left:0.2em;text-align:justify;\">This tutorial has been prepared for the beginners to help them understand the basic to advanced concepts related to Java Programming language.</p><h2>Prerequisites</h2><p style=\"margin-left:0.2em;text-align:justify;\">Before you start practicing various types of examples given in this reference, we assume that you are already aware about computer programs and computer programming languages.</p><p>&nbsp;</p>',_binary '\0',NULL,'','NORMAL','user917','2021-07-31 14:52:57.074','user917','2021-07-31 14:52:57.074',_binary '\0'),(1098,124,1,'a;lskjdfalhjksdfhjkl','asdlfkjasjkldfhjk','<p>laksjdfklajsdfjklasd askld f ahsdfhaj sdfajsdf d</p>',_binary '\0',NULL,'','NORMAL','user917','2021-07-31 14:54:30.698','user917','2021-08-28 00:53:24.994',_binary ''),(1099,1,1,'aklsjdfajklsdflhjk','sdasdfasdflijkh','<p>klajshdfhkasjdf asdkf asdfklh asdkl jfasdhjklf jklasdf hjkl</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 14:55:10.930','user','2021-08-06 17:26:31.644',_binary ''),(1100,1,1,'asdfoals khjdf','asdfasdf  oh oajkshdlf asdf','<p>k ljkhlaksjdfhjkla sdfasdf&nbsp;</p>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 14:56:00.839','user','2021-08-06 17:26:40.240',_binary ''),(1101,124,1,'abcd','abcd','<p>abcd</p>',_binary '\0',NULL,'','NORMAL','user917','2021-07-31 14:56:52.035','user917','2021-08-06 16:54:58.338',_binary ''),(1102,1,1,'dfasdfas','dasdf','<p>dfasdfasdfasdf</p><figure class=\"image\"><img src=\"https://highblog.codes/images/196631011_963931057790911_5806450502741513147_n162774476616444304.jpg\"></figure>',_binary '\0',NULL,'','NORMAL','user','2021-07-31 15:19:27.540','user','2021-08-06 17:26:44.452',_binary ''),(1103,539,2,'test','test','<p>test test</p>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:00:51.364','user6','2021-08-06 15:00:51.364',_binary '\0'),(1104,539,1,'How Prisma and Next.js Fit Together','Next.js blurs the lines between client and server. It supports pre-rendering pages at build time (SSG) or request time (SSR). Prisma is the perfect companion if you need to work with a database in a Next.js app.','<h3 style=\"margin-left:0px;\"><strong>Static Site Generation with Prisma</strong></h3><p style=\"margin-left:0px;\">The getStaticProps function in Next.js is executed at build time for static site generation (SSG). It\'s commonly used for <i>static</i> pages, like blogs and marketing sites. You can use Prisma inside of getStaticProps to send queries to your database:</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgb(255,255,255);\">Next.js will pass the </span>props<span style=\"background-color:rgb(255,255,255);\"> to your React components, enabling static rendering of your page with dynamic data.</span></p><figure class=\"image\"><img src=\"https://highblog.codes/images/download162826276516937988.png\"></figure><p style=\"margin-left:0px;\"><i>Next.js and Prisma is the <strong>ultimate combo</strong> if you need a database in React apps! Depending on your needs, you can query your database with Prisma in Next.js API routes, in getServerSideProps or in getStaticProps for full rendering flexibility and top performance </i></p>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:12:58.081','user6','2021-08-06 15:12:58.081',_binary '\0'),(1105,1,1,'Introduction to React Context API','React Context API is a React API that allows one to share state across an entire app. Instead of installing a state management library in your project or prop drilling','<p style=\"margin-left:0;\">React hook that is needed for this purpose is <i>createContext()</i>. It returns a provider and a consumer. The provider, as the name suggests, provides a state to its children whereas the consumer uses the state.</p><p style=\"margin-left:0;\">Example 1: -<br>&nbsp;</p><pre><code class=\"language-plaintext\">import React, { createContext } from \"react\";\n\n// creating a context\nconst StateContext = createContext();\n\nexport default function App() {\n  return (\n    &lt;StateContext.Provider value={56}&gt;\n      &lt;ShowValue /&gt;\n    &lt;/StateContext.Provider&gt;\n  );\n}\n\nfunction ShowValue() {\n  return (\n    &lt;StateContext.Consumer&gt;\n      {(value) =&gt; &lt;p&gt;The display value is: {value}.&lt;/p&gt;}\n    &lt;/StateContext.Consumer&gt;\n  );\n}\n</code></pre><p style=\"margin-left:0;\">&nbsp;</p><blockquote><p style=\"margin-left:0;\">To see the working implementation of the above example, click <a href=\"https://codesandbox.io/s/createcontext-s8p97\"><u>here</u></a>.</p></blockquote><p style=\"margin-left:0;\">In the example above, we created a context. Now think of creating a context as creating a data layer. After the context is created, we wrapped a component (i.e., <i>ShowValue component</i>) in the data layer so that the data or value is accessible in that component. Finally, the data (or value) is fetched using the consumer. Note that the consumer obtains the value passed by the <i>provider</i> without prop drilling.</p><p style=\"margin-left:0;\">Using react Context API lets you avoid passing of props from parent component to children components. It\'s all good until you need to pass multiple values. In case of retrieving data from multiple parent contexts, a lot of nesting is introduced.<br>&nbsp;</p><pre><code class=\"language-plaintext\">&lt;CurrentUser.Consumer&gt;\n      {user =&gt;\n        &lt;Notifications.Consumer&gt;\n          {notifications =&gt;\n            &lt;header&gt;\n              Welcome back, {user.name}!\n              You have {notifications.length} notifications.\n            &lt;/header&gt;\n          }\n        &lt;/Notifications.Consumer&gt;\n      }\n    &lt;/CurrentUser.Consumer&gt;\n</code></pre><p style=\"margin-left:0;\">&nbsp;</p><p style=\"margin-left:0;\">Therefore, to make the code less verbose we use <i>useContext() hook</i>.</p><h4 style=\"margin-left:0;\">useContext hook: -</h4><p style=\"margin-left:0;\">The useContext() hook provides a way to pass the data or value to any component without using the consumer. Further, it makes the code more readable and reduces cognitive overhead (i.e., the used amount of working memory resources).</p><p style=\"margin-left:0;\">With useContext() hook, the code in example 1 will look like this: -<br>&nbsp;</p><pre><code class=\"language-plaintext\">import React, { createContext, useContext } from \"react\";\n\nconst StateContext = createContext();\nconst useStateValue = () =&gt; useContext(StateContext);\n\nexport default function App() {\n  return (\n    &lt;StateContext.Provider value={56}&gt;\n      &lt;ShowValue /&gt;\n    &lt;/StateContext.Provider&gt;\n  );\n}\n\nfunction ShowValue() {\nconst value = useStateValue();\n  return (\n      &lt;p&gt;The display value is: {value}.&lt;/p&gt;\n    );\n}\n</code></pre><p style=\"margin-left:0;\">&nbsp;</p><blockquote><p style=\"margin-left:0;\">To see the working implementation of the above example, click <a href=\"https://codesandbox.io/s/usecontext-hook-fzh63?file=/src/App.js\"><u>here</u></a>.</p><p style=\"margin-left:0;\">Note: To further manage the state of the app, <i>useReducer() hook</i> is used.</p></blockquote><h3 style=\"margin-left:0;\">Conclusion</h3><p style=\"margin-left:0;\">By using React Context API, we can produce global variables that can be passed around an entire application and avoid prop drilling. For this purpose, the createContext and the useContext hooks are used. In addition, the useReducer hook can also be used in the case of managing the state of the app.</p><p>P.S. Context API should only be used when you need to share state between many components with a lot of nesting.</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-06 15:13:47.517','user','2021-08-06 17:55:28.896',_binary '\0'),(1106,1028,1,'Mt s mo iu chnh hiu nng trong Mysql','Mysql l h qun tr c s d liu ph bin nht hin. N mnh m v h tr ta rt nhiu th tuyt vi','<h2 style=\"margin-left:0px;\"><strong>La chn Local Storage Engine ph hp</strong></h2><p>Mysql h tr kh nhiu loi Local Storage Engine ph hp vi nhiu mc ch s dng khc nhau. Nhng ti ch gii thiu 2 loi ph bin nht l MyISAM v InnoDB.</p><figure class=\"table\" style=\"width:730px;\"><table style=\"background-color:rgb(255, 255, 255);\"><thead><tr><th style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">MyISAM</th><th style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">InnoDB</th></tr></thead><tbody><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">H tr Table - Level Loking</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">H tr Row - Level Locking</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">c thit k cho nhu cu v tc  (speed)</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">c thit k  t hiu sut ti a khi x l lng d liu ln</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Khng h tr Foreign keys v th nn chng ta gi MySQL vi MyISAM l DBMS</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">H tr Foreign keys v th nn chng ta gi MySQL vi InnoDB l RDBMS</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Lu tr tables, data, indexes ca n trong khng gian a bng cch s dng 3 file ring bit (table_name.FRM, table_name.MYD, table_name.MYI)</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Lu tr tables, indexes ca n trong 1 khng gian bng</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Khng h tr Transaction</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">C h tr Transaction</td></tr><tr><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">H tr Full</td><td style=\"border-bottom:1px solid rgb(214, 214, 215);border-left:1px solid rgb(214, 214, 215);border-right:1px solid rgb(214, 214, 215);border-top:1px solid rgb(214, 214, 215);padding:0.75rem;vertical-align:top;\">Text Search</td></tr></tbody></table></figure><blockquote><p>Tm ci vy li th nu ng dng ca bn cn truy xut(SELECT) thng tin nhiu v t c cc action Insert/Update d liu th nn s dng MyISAM  c hiu sut tt nht. V d nh: Blog, News...Ngc li, ng dng cu bn yu cu vic Insert/ Update d liu lin tc, v c c nhng nghip v yu cu s dng transaction nh payment,... th nn s dng InnoDB. V d nh : Forum, Socials network,...</p></blockquote><h2 style=\"margin-left:0px;\"><strong>ng qun nh index</strong></h2><p>B qua nhng l thuyt nh cy nh phn hay index kiu Btree. Th chng ta hy hiu n gin nh sau. Nu 1 cu truy vn khng kt hp vi index th sql s phi c ln lt tt c bn ghi trong 1 table. Sau  ly ra nhng bn ghi ph hp v tr v kt qu cho chng ta. Nhng nu s dng index, bng mt magic no , Ging nh mc lc ca 1 trang sch vi. Ta ch cn vo  v bit c nhng trang sch m ta cn  u. Vo  ly ra hoy ch khng cn phi lt ln lt tng trang mt =)) y l l thuyt ca mt thng th li vi ln thi cc bn ng ci :3</p><p>Quay v vi thc ti, Chng ta nn lu  2 iu sau trc khui quyt nh nh index cho 1 trng.</p><ul><li>Index lm tng tc  truy vn cho cc mnh : Order By, Group By, Where, Join,..</li><li>Nhng cng chnh n l nguyn nhn ca vic insert, update b chm. V sao  ? n gin l ci mc lc ang yn ang lnh li phi nh li khi c action insert/update. V n s tr thnh 1 vn  nu cc action ny l lin tc v lng data ln.</li></ul><h2 style=\"margin-left:0px;\"><strong>Truy vn phc tp hay nhiu truy vn</strong></h2><p>Theo li nh ca thit k c s d liu nhn mnh vic thc hin cng nhiu cng vic cng tt vi cng t truy vn cng tt. Nghe cng thuyt phc =)) Nhng li khng hon ton ng. Cch tip cn ny v mt lch s tt hn v chi ph truyn thng mng v chi ph ca cc giai on parsing v optimization.</p><p>Tuy nhin, li khuyn ny khng p dng nhiu cho MySQL, v n c thit k  x l kt ni v ngt kt ni rt hiu qu v phn hi cc truy vn nh v n gin rt nhanh chng. Mng hin i cng nhanh hn ng k so vi trc y, gim  tr ca mng. Theo 1 thng k t trn mng (khng phi VOZ u nh. Cc bn yn tm =)) ) MySQL c th chy hn 50.000 truy vn n gin mi giy trn phn cng my ch hng ha v hn 2.000 truy vn mi giy. V vy vic chy nhiu truy vn khng nht thit l mt iu t.</p><p>Nu cc  tm hiu v cu trc mysql th hn s nh n giai on conection handing parsing v optimization. Nu cha nm r th ti xin gii thiu n cc bn 1 bi v <a href=\"https://viblo.asia/p/tim-hieu-mysql-architecture-RnB5pj9JZPG\">Mysql Architecture</a> cng ca ci thng th li CSDL 2 ln =))</p><h2 style=\"margin-left:0px;\"><strong>Ct nh mt truy vn</strong></h2><p>Ti xin dn chng 1 cu ni kh hay nh sau: \"Chia  tr =))\". Tht vy, trong nhiu trng hp m ph bin nht chnh l khi insert/delete d liu. Chng ta s c rt l nhiu record, c th lin quan n vi bng khc nhau cn thao tc. Nu c c m n xi th rt c th xi hng bng khng . Vy cho nn li khuyn ca ti l hy chia n thnh nhiu cu query nh. V insert tng  vo DB thi nh :v VD:</p><pre><code class=\"language-plaintext\">rows_affected = 0\ndo {\n   rows_affected = do_query(\n      \"DELETE FROM messages WHERE created &lt; DATE_SUB(NOW(),INTERVAL 3 MONTH)\n      LIMIT 10000\")\n} while rows_affected &gt; 0\n</code></pre><h2 style=\"margin-left:0px;\"><strong>Join Decomposition</strong></h2><p>Nhiu trang web hiu sut cao s dng Join Decomposition. Bn c th phn tch mt mnh  Join bng cch chy nhiu truy vn bng n. Cng thao kho v d di y  thy r hn nh.</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT * FROM tag\n    -&gt;    JOIN tag_post ON tag_post.tag_id=tag.id\n    -&gt;    JOIN post ON tag_post.post_id=post.id\n    -&gt;WHERE tag.tag=\'mysql\';\n</code></pre><p>Bn c th chuyn thnh cc truy vn sau:</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT * FROM  tag WHERE tag=\'mysql\';\nmysql&gt; SELECT * FROM  tag_post WHERE tag_id=1234;\nmysql&gt; SELECT * FROM  post WHERE  post.id in (123,456,567,9098,8904);\n</code></pre><p>iu ny thot nhn c v lng ph v bn  tng s lng truy vn m khng nhn li c g. Tuy nhin, iu bt ng thng n sau&nbsp;</p><figure class=\"image\"><img src=\"https://twemoji.maxcdn.com/2/72x72/1f604.png\" alt=\"\"></figure><p>:</p><p>B nh m c th hiu qu hn. Nhiu ng dng caches cc i tng c nh x trc tip n cc bng. Trong v d ny, nu bn tm thy cc bi ng c id l 123, 567 hoc 9098 trong b nh cache, th chng c th b qua vic truy vn vo li v ly kt qu trc tip t b nh cache.</p><p>i vi bng MyISAM, thc hin mt truy vn trn mi bng s dng table locks hiu qu hn. Cc truy vn s lock cc bng ring l dn n thi gian lock tng i ngn. Thay v phi lock tt c chng trong mt thi gian di hn.</p><p>D dng m rng c s d liu bng cch t cc bng trn cc my ch khc nhau.</p><p>Bn thn cc truy vn c th hiu qu hn. Trong v d ny, vic s dng mt danh sch IN() thay v mt php Join cho php MySQL sp xp cc ID hng v truy xut cc hng mt cch ti u hn nhng g c th c vi Join.</p><p>Bn c th gim cc truy cp hng tha. Thc hin php Join trong <strong>ng dng</strong> c ngha l bn ch truy xut mi hng mt ln, trong khi php Join trong <strong>truy vn</strong> v c bn l mt qu trnh khng chun ha c th truy cp nhiu ln vo cng mt d liu. V l do tng t, chng hn ti cu trc cng c th lm gim tng lu lng mng v s dng b nh.</p><p> mt mc  no , bn c th xem k thut ny nh vic trin khai th cng mt php Hash Join thay v thut ton cc vng lng nhau m MySQL s dng  thc hin mt php Join.</p><h2 style=\"margin-left:0px;\"><strong>Cn g th ly y</strong></h2><p>Nhiu cu truy vn ang yu nhiu d liu hn mc cn thit, ri sau  li loi b nhng thng tin tha ny i. iu ny khin cho mysql phi lm vic nhiu hn, tn chi ph mng, tiu tn b nh v ti nguyn CPU trn my ch.</p><h2 style=\"margin-left:0px;\"><strong>Ly ra tt c cc ct:</strong></h2><p>Chng ta  kh quen thuc vi cu lnh SELECT s ly ra ton b cc hng. Nhng nu yu cu ch l hin th thng tin ca 10 users th hy thm cho cu truy vn ca bn limit(10) nh.</p><h2 style=\"margin-left:0px;\"><strong>Ly ra ton b thng tin t cc bng lin quan</strong></h2><p>Cng theo di cu query di y nh</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT * FROM test_db.users\n    -&gt; INNER JOIN test_db.comments USING(post_id)\n    -&gt; INNER JOIN test_db.posts USING(user_id)\n    -&gt;WHERE sakila.posts.title = \'yasuo\'\n</code></pre><p>Cu truy vn trn s ly ra ton b thng tin cu 3 bng users, posts, comments. Thay vo  chng ta c th vit nh sau: SELECT test_db.users.* FROM ...</p><h2 style=\"margin-left:0px;\"><strong>Ly ra tt c cc ct:</strong></h2><p>y c th ni l 1 trong nhng li c bn v ph bin nht. Mi khi nhn thy 1 cu truy vn c Select *..., iu u tin bn nn t 1 cu hi rng: \"Liu chng ta c cn ht tt c thng tin ?\". Chc l khng :v. Vic truy vt ton cc ct ca 1 bng c th dn n vic ngn cn ti u ho nh covering indexes, tng I/O, b nh cng nh chi ph cho my ch.</p><h2 style=\"margin-left:0px;\"><strong>Cn thn vi Like %</strong></h2><p>Khi truy vn vi mnh  LIKE th ta hay kt hp vi k t %  c th search hiu qu hn. Nhng hy cn thn v nu ta s dng Like %keyword th s gy ra qu trnh qut ton b bng. V kin cu query ca bn tr nn so bad.</p><h2 style=\"margin-left:0px;\"><strong>Ch s dng DISTINCT v UNION khi cn thit</strong></h2><p>Vic s dng cc ton t UNION v DISTINCT m khng c bt k mc ch chnh no gy ra vic sp xp khng mong mun v lm chm qu trnh thc thi SQL. Thay v UNION, s dng UNION ALL mang li hiu qu hn trong quy trnh v ci thin hiu sut MySQL chnh xc hn.</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT film_id, description FROM sakila.film ORDER BY title LIMIT 50, 5;\n</code></pre><p>Nu bng rt ln, truy vn ny c vit tt hn nh sau:</p><pre><code class=\"language-plaintext\">mysql&gt; SELECT film.film_id, film.description\n    -&gt; FROM sakila.film\n    -&gt;    INNER JOIN (\n    -&gt;       SELECT film_id FROM sakila.film\n    -&gt;       ORDER BY title LIMIT 50, 5\n    -&gt;   ) AS lim USING(film_id);\n</code></pre>',_binary '\0',NULL,'images/colorful-palm-silhouettes-background_23-2148541792162826286603371242.jpg','NORMAL','ninhthuanntnt11yopmail','2021-08-06 15:15:50.649','ninhthuanntnt11yopmail','2021-08-06 15:15:50.649',_binary '\0'),(1107,1028,1,'asdf','Test draft','<p>asdf</p>',_binary '\0',NULL,'','DRAFT','ninhthuanntnt11yopmail','2021-08-06 15:16:52.734','ninhthuanntnt11yopmail','2021-08-06 15:16:52.734',_binary '\0'),(1108,539,1,'222222222222','111111111111111','<p>wewewewewewe</p>',_binary '\0',NULL,'','DRAFT','user6','2021-08-06 15:17:36.943','user6','2021-08-06 15:17:36.943',_binary '\0'),(1109,539,1,'The Intuitive\nVue Framework','Build your next Vue.js application with confidence using NuxtJS. An open source framework making web development simple and powerful.','<p><span style=\"background-color:rgb(255,255,255);\">NuxtJS is an MIT licensed open source project and completely free to use. However, the amount of effort needed to maintain and develop new features for the project is not sustainable without proper financial backing. If you run a business and are using Nuxt in a revenue-generating product, it makes business sense to sponsor Nuxt development: it ensures the project that your product relies on stays healthy and actively maintained. It can also help your exposure in the Vue/Nuxt community and makes it easier to attract Vue/Nuxt developers. If you are an individual user and have enjoyed the productivity of using Nuxt, consider donating as a sign of appreciation.</span></p>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:19:53.487','user6','2021-08-06 15:19:53.487',_binary '\0'),(1110,539,1,'C++ \"Hello, World!\" Program','The #include is a preprocessor directive used to include files in our program. The above code is including the contents of the iostream file.\n','<h2 style=\"margin-left:0px;\">C++ \"Hello, World!\" Program</h2><p style=\"margin-left:0px;\">In this example, we will learn to create a simple program named \"Hello World\" in C++ programming.</p><p style=\"margin-left:0px;\">A <strong>\"Hello, World!\"</strong> is a simple program that outputs Hello, World! on the screen. Since it\'s a very simple program, it\'s often used to introduce a new programming language to a newbie.</p><p style=\"margin-left:0px;\">Let\'s see how C++ \"Hello, World!\" program works.</p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">If you haven\'t already set up the environment to run C++ on your computer, visit Install <i>C++ on Your Computer</i>.</p><hr><h2 style=\"margin-left:0px;\">C++ \"Hello World!\" Program</h2><pre><code class=\"language-plaintext\">// Your First C++ Program\n\n#include &lt;iostream&gt;\n\nint main() {\n    std::cout &lt;&lt; \"Hello World!\";\n    return 0;\n}\n</code></pre><p style=\"margin-left:0px;\"><strong>Output</strong></p><p style=\"margin-left:0px;\">Hello World!\n</p><hr><h2 style=\"margin-left:0px;\">Working of C++ \"Hello World!\" Program</h2><ol><li>// Your First C++ Program<br><br>In C++, any line starting with // is a comment. Comments are intended for the person reading the code to better understand the functionality of the program. It is completely ignored by the C++ compiler.</li><li>#include &lt;iostream&gt;<br><br>The #include is a preprocessor directive used to include files in our program. The above code is including the contents of the <strong>iostream</strong> file.<br><br>This allows us to use cout in our program to print output on the screen.<br><br>For now, just remember that we need to use #include &lt;iostream&gt; to use cout that allows us to print output on the screen.</li><li>int main() {...}<br><br>A valid C++ program must have the main() function. The curly braces indicate the start and the end of the function.<br><br>The execution of code beings from this function.</li><li>std::cout &lt;&lt; \"Hello World!\";<br><br>std::cout prints the content inside the quotation marks. It must be followed by &lt;&lt; followed by the format string. In our example, \"Hello World!\" is the format string.<br><br><strong>Note:</strong>&nbsp;; is used to indicate the end of a statement.</li><li>return 0;<br><br>The return 0; statement is the <strong>\"Exit status\"</strong> of the program. In simple terms, the program ends with this statement.</li></ol>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 15:25:48.025','user6','2021-08-06 15:25:48.025',_binary '\0'),(1114,1028,1,'asdasd','asdasd','<p>asdasd</p>',_binary '\0',NULL,'','NORMAL','ninhthuanntnt11yopmail','2021-08-06 16:55:32.513','ninhthuanntnt11yopmail','2021-08-06 16:55:34.924',_binary ''),(1115,1,1,'10 Trending projects on GitHub for web developers - 6th August 2021','Trending Projects is available as a weekly newsletter please sign up at www.iainfreestone.com to ensure you never miss an issue.','<h3 style=\"margin-left:0;\">1. Radix Primitives</h3><p style=\"margin-left:0;\">An open-source UI component library for building high-quality, accessible design systems and web apps.</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-06 17:32:37.742','user','2021-08-06 18:12:46.290',_binary ''),(1116,539,1,'Why Learn C#?','C# is one of the most popular programming languages and can be used for a variety of things, including mobile applications, game development, and enterprise software. Knowing C# opens a great deal of doors for you as a developer.','<h3><strong>Why Learn C#?</strong></h3><p>C# is one of the most popular programming languages and can be used for a variety of things, including mobile applications, game development, and enterprise software. Knowing C# opens a great deal of doors for you as a developer.</p><h3><strong>Take-Away Skills</strong></h3><p>In this course, youll be exposed to fundamental programming concepts using C# and start writing programs right away. Youll build several projects to help you practice and test your knowledge using quizzes.</p><h3><strong>Upcoming Releases</strong></h3><p>Were continuing to build new and exciting content for this course! Keep an eye out in upcoming months for new modules that cover object-oriented programming (OOP), control flow, arrays, and loops.</p><p style=\"margin-left:6.25rem;text-align:center;\">Earn<strong>Certificate</strong>of completion with&nbsp;</p><p style=\"margin-left:6.25rem;text-align:center;\">Join<strong>45,000,000+</strong>Codecademy learners</p><p style=\"margin-left:6.25rem;text-align:center;\">Time to Complete<strong>30 Hours</strong></p><p style=\"margin-left:6.25rem;text-align:center;\">Prerequisites<strong>None</strong></p><h3><strong>Codecademy courses have been taken by employees at</strong></h3><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/c41d5739bf341f298860a4e1c0bd432e.svg\" alt=\"Google Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/6a7687a155efb7887a81c9703b4021c8.svg\" alt=\"Facebook Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/77d0701a433ad10d7ac30c5ed14b13d4.svg\" alt=\"NASA Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/0c078975ab7d71b7643795ab182fb143.svg\" alt=\"IBM Logo\"></figure><figure class=\"image\"><img src=\"https://www.codecademy.com/webpack/a02a53ff8d84511eae365560aaa12a01.svg\" alt=\"Dropbox Logo\"></figure>',_binary '\0',NULL,'','NORMAL','user6','2021-08-06 17:39:17.086','user6','2021-08-06 17:39:17.086',_binary '\0'),(1117,1,2,'dfsdfsdfds','','<p>sdfsdfsdfsdfsdfsdf<strong>sdfsdfsdfsdf</strong></p>',_binary '\0',NULL,'','DRAFT','user','2021-08-06 17:55:55.424','user','2021-08-06 17:55:55.424',_binary '\0'),(1118,1,1,'Hng dn deploy ReactJS without css','','<p>Hello world</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-06 18:13:32.623','user','2021-08-06 18:24:39.190',_binary '\0'),(1119,124,1,'test tags','ksgkagkggk','<p>aaadfghthh<