to start the <a href=\"https://dev.mysql.com/doc/refman/8.0/en/osx-installation-pkg.html\">installation wizard</a>.</p><p>If you choose not to start MySQL automatically, it can be started from the icon in the System Preferences pane:</p><figure class=\"image\"><img src=\"https://uploads.sitepoint.com/wp-content/uploads/2009/03/1580172240mysql-install-macos.png\" alt=\"MySQL in macOS System Preferences\" srcset=\"https://uploads.sitepoint.com/wp-content/uploads/2009/03/1580172240mysql-install-macos.png 668w, https://uploads.sitepoint.com/wp-content/uploads/2009/03/1580172240mysql-install-macos-300x269.png 300w\" sizes=\"100vw\" width=\"668\"></figure><p>It is also possible to install MySQL on macOS using:</p><ul><li>homebrew: brew install mysql</li><li>the <a href=\"https://dbngin.com/\">DBngin</a> management tool, or</li><li>the <a href=\"https://dev.mysql.com/doc/refman/8.0/en/binary-installation.html\">generic binaries</a></li></ul>',_binary '\0',NULL,'','NORMAL','user12','2021-08-27 14:40:34.777','user12','2021-08-27 14:40:34.777',_binary '\0'),(1131,731,1,'What is DevOps?','DevOps is the combination of cultural philosophies, practices, and tools that increases an organizations ability to deliver applications and services at high velocity: evolving and improving products at a faster pace than organizations using traditional software development and infrastructure management processes. This speed enables organizations to better serve their customers and compete more effectively in the market.\n\n','<h2 style=\"margin-left:auto;\">DevOps Model Defined</h2><p style=\"margin-left:auto;\">DevOps is the combination of cultural philosophies, practices, and tools that increases an organizations ability to deliver applications and services at high velocity: evolving and improving products at a faster pace than organizations using traditional software development and infrastructure management processes. This speed enables organizations to better serve their customers and compete more effectively in the market.</p><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/product-marketing/DevOps/DevOps_feedback-diagram.ff668bfc299abada00b2dcbdc9ce2389bd3dce3f.png\" alt=\"What is DevOps?\"></figure><h2 style=\"margin-left:auto;\">How DevOps Works</h2><p style=\"margin-left:auto;\">Under a DevOps model, development and operations teams are no longer siloed. Sometimes, these two teams are merged into a single team where the engineers work across the entire application lifecycle, from development and test to deployment to operations, and develop a range of skills not limited to a single function.</p><p style=\"margin-left:auto;\">In some DevOps models, quality assurance and security teams may also become more tightly integrated with development and operations and throughout the application lifecycle. When security is the focus of everyone on a DevOps team, this is sometimes referred to as DevSecOps.<br>&nbsp;</p><p style=\"margin-left:auto;\">These teams use practices to automate processes that historically have been manual and slow. They use a technology stack and tooling which help them operate and evolve applications quickly and reliably. These tools also help engineers independently accomplish tasks (for example, deploying code or provisioning infrastructure) that normally would have required help from other teams, and this further increases a teams velocity.</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/devops/\">Learn about AWS DevOps tooling and services </a></p><h2 style=\"margin-left:auto;\">Benefits of DevOps</h2><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_scale.87cace0a71f7578eb8aa79e61baa18e850b0e9ca.png\" alt=\"DevOps-What-is_scale\"></figure><h3 style=\"margin-left:auto;text-align:right;\">Speed</h3><p style=\"margin-left:auto;text-align:right;\">Move at high velocity so you can innovate for customers faster, adapt to changing markets better, and grow more efficient at driving business results. The DevOps model enables your developers and operations teams to achieve these results. For example, <a href=\"https://aws.amazon.com/devops/what-is-devops/#microservices\">microservices</a> and <a href=\"https://aws.amazon.com/devops/continuous-delivery/\">continuous delivery</a> let teams take ownership of services and then release updates to them quicker.<br>&nbsp;</p><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_delivery.ab8e4f4580bd50ef2536ac6726d8c599c0a321da.png\" alt=\"DevOps-What-is_delivery\"></figure><h3 style=\"margin-left:auto;text-align:right;\">Rapid Delivery</h3><p style=\"margin-left:auto;text-align:right;\">Increase the frequency and pace of releases so you can innovate and improve your product faster. The quicker you can release new features and fix bugs, the faster you can respond to your customers needs and build competitive advantage. <a href=\"https://aws.amazon.com/devops/continuous-integration/\">Continuous integration</a> and <a href=\"https://aws.amazon.com/devops/continuous-delivery/\">continuous delivery</a> are practices that automate the software release process, from build to deploy.</p><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_reliability.d515ffafa232e62e769d9f2bbf78f4160f3239ad.png\" alt=\"DevOps-What-is_reliability\"></figure><h3 style=\"margin-left:auto;text-align:right;\">Reliability</h3><p style=\"margin-left:auto;text-align:right;\">Ensure the quality of application updates and infrastructure changes so you can reliably deliver at a more rapid pace while maintaining a positive experience for end users. Use practices like <a href=\"https://aws.amazon.com/devops/continuous-integration/\">continuous integration</a> and <a href=\"https://aws.amazon.com/devops/continuous-delivery/\">continuous delivery</a> to test that each change is functional and safe. <a href=\"https://aws.amazon.com/devops/what-is-devops/#monitoring\">Monitoring and logging</a> practices help you stay informed of performance in real-time.<br>&nbsp;</p><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_scale.87cace0a71f7578eb8aa79e61baa18e850b0e9ca.png\" alt=\"DevOps-What-is_scale\"></figure><h3 style=\"margin-left:auto;text-align:right;\">Scale</h3><p style=\"margin-left:auto;text-align:right;\">Operate and manage your infrastructure and development processes at scale. Automation and consistency help you manage complex or changing systems efficiently and with reduced risk. For example, <a href=\"https://aws.amazon.com/devops/what-is-devops/#iac\">infrastructure as code</a> helps you manage your development, testing, and production environments in a repeatable and more efficient manner.<br>&nbsp;</p><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_collaboration.135599d9c5b1f67bc1a40a7d4295cda99a30d7ff.png\" alt=\"DevOps-What-is_collaboration\"></figure><h3 style=\"margin-left:auto;text-align:right;\">Improved Collaboration</h3><p style=\"margin-left:auto;text-align:right;\">Build more effective teams under a DevOps cultural model, which emphasizes values such as ownership and accountability. Developers and operations teams <a href=\"https://aws.amazon.com/devops/what-is-devops/#communication\">collaborate</a> closely, share many responsibilities, and combine their workflows. This reduces inefficiencies and saves time (e.g. reduced handover periods between developers and operations, writing code that takes into account the environment in which it is run).<br>&nbsp;</p><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_security.4246af1c9c37ce52cca4fac51f786a524836e04d.png\" alt=\"DevOps-What-is_security\"></figure><h3 style=\"margin-left:auto;text-align:right;\">Security</h3><p style=\"margin-left:auto;text-align:right;\">Move quickly while retaining control and preserving compliance. You can adopt a DevOps model without sacrificing security by using automated compliance policies, fine-grained controls, and configuration management techniques. For example, using infrastructure as code and <a href=\"https://aws.amazon.com/devops/what-is-devops/#policyascode\">policy as code</a>, you can define and then track compliance at scale.</p><h2 style=\"margin-left:auto;\">Why DevOps Matters</h2><p style=\"margin-left:auto;\">Software and the Internet have transformed the world and its industries, from shopping to entertainment to banking. Software no longer merely supports a business; rather it becomes an integral component of every part of a business. Companies interact with their customers through software delivered as online services or applications and on all sorts of devices. They also use software to increase operational efficiencies by transforming every part of the value chain, such as logistics, communications, and operations. In a similar way that physical goods companies transformed how they design, build, and deliver products using industrial automation throughout the 20th century, companies in todays world must transform how they build and deliver software.<br>&nbsp;</p><h2 style=\"margin-left:auto;\">How to Adopt a DevOps Model</h2><h2 style=\"margin-left:auto;\">DevOps Cultural Philosophy</h2><p style=\"margin-left:auto;\">Transitioning to DevOps requires a change in culture and mindset. At its simplest, DevOps is about removing the barriers between two traditionally siloed teams, development and operations. In some organizations, there may not even be separate development and operations teams; engineers may do both. With DevOps, the two teams work together to optimize both the productivity of developers and the reliability of operations. They strive to communicate frequently, increase efficiencies, and improve the quality of services they provide to customers. They take full ownership for their services, often beyond where their stated roles or titles have traditionally been scoped by thinking about the end customers needs and how they can contribute to solving those needs.&nbsp;Quality assurance and security teams may also become tightly integrated with these teams. Organizations using a DevOps model, regardless of their organizational structure, have teams that view the entire development and infrastructure lifecycle as part of their responsibilities.<br>&nbsp;</p><h2 style=\"margin-left:auto;\">DevOps Practices Explained</h2><p style=\"margin-left:auto;\">There are a few key practices that help organizations innovate faster through automating and streamlining the software development and infrastructure management processes. Most of these practices are accomplished with proper tooling.</p><p style=\"margin-left:auto;\">One fundamental practice is to perform very frequent but small updates. This is how organizations innovate faster for their customers. These updates are usually more incremental in nature than the occasional updates performed under traditional release practices. Frequent but small updates make each deployment less risky. They help teams address bugs faster because teams can identify the last deployment that caused the error. Although the cadence and size of updates will vary, organizations using a DevOps model deploy updates much more often than organizations using traditional software development practices.</p><p style=\"margin-left:auto;\">Organizations might also use a microservices architecture to make their applications more flexible and enable quicker innovation. The microservices architecture decouples large, complex systems into simple, independent projects. Applications are broken into many individual components (services) with each service scoped to a single purpose or function and operated independently of its peer services and the application as a whole. This architecture reduces the coordination overhead of updating applications, and when each service is paired with small, agile teams who take ownership of each service, organizations can move more quickly.</p><p style=\"margin-left:auto;\">However, the combination of microservices and increased release frequency leads to significantly more deployments which can present operational challenges. Thus, DevOps practices like continuous integration and continuous delivery solve these issues and let organizations deliver rapidly in a safe and reliable manner. Infrastructure automation practices, like infrastructure as code and configuration management, help to keep computing resources elastic and responsive to frequent changes. In addition, the use of monitoring and logging helps engineers track the performance of applications and infrastructure so they can react quickly to problems.</p><p style=\"margin-left:auto;\">Together, these practices help organizations deliver faster, more reliable updates to their customers. Here is an overview of important DevOps practices.<br>&nbsp;</p><hr><h2 style=\"margin-left:auto;\">DevOps Practices</h2><p style=\"margin-left:auto;\">The following are DevOps best practices:&nbsp;</p><ul><li><a href=\"https://aws.amazon.com/devops/what-is-devops/#integration\">Continuous Integration</a></li><li><a href=\"https://aws.amazon.com/devops/what-is-devops/#cd\">Continuous Delivery</a></li><li><a href=\"https://aws.amazon.com/devops/what-is-devops/#microservices\">Microservices</a></li><li><a href=\"https://aws.amazon.com/devops/what-is-devops/#iac\">Infrastructure as Code</a></li><li><a href=\"https://aws.amazon.com/devops/what-is-devops/#monitoring\">Monitoring and Logging</a></li><li><a href=\"https://aws.amazon.com/devops/what-is-devops/#communication\">Communication and Collaboration</a></li></ul><p style=\"margin-left:auto;\">Below you can learn more about each particular practice.</p><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_continuous-integration.3f6fc6ea0386fa699174fe40917dde0e0c5b954a.png\" alt=\"Continuous Integration\"></figure><h3 style=\"margin-left:auto;\">Continuous Integration</h3><p style=\"margin-left:auto;\">Continuous integration is a software development practice where developers regularly merge their code changes into a central repository, after which automated builds and tests are run. The key goals of continuous integration are to find and address bugs quicker, improve software quality, and reduce the time it takes to validate and release new software updates.</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/devops/continuous-integration/\">Learn more about continuous integration </a><br>&nbsp;</p><hr><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_continuous-delivery.65d73ec797fea2064c44a3682d249264f7d64eac.png\" alt=\"Continuous Delivery\"></figure><h3 style=\"margin-left:auto;\">Continuous Delivery</h3><p style=\"margin-left:auto;\">Continuous delivery is a software development practice where code changes are automatically built, tested, and prepared for a release to production. It expands upon continuous integration by deploying all code changes to a testing environment and/or a production environment after the build stage. When continuous delivery is implemented properly, developers will always have a deployment-ready build artifact that has passed through a standardized test process.<br>&nbsp;</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/devops/continuous-delivery/\">Learn more about continuous delivery and AWS CodePipeline </a><br>&nbsp;</p><hr><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_microservices.3a506e14bb8fb85a350346bdc76ddd33a7e73586.png\" alt=\"Microservices\"></figure><h3 style=\"margin-left:auto;\">Microservices</h3><p style=\"margin-left:auto;\">The microservices architecture is a design approach to build a single application as a set of small services. Each service runs in its own process and communicates with other services through a well-defined interface using a lightweight mechanism, typically an HTTP-based application programming interface (API). Microservices are built around business capabilities; each service is scoped to a single purpose. You can use different frameworks or programming languages to write microservices and deploy them independently, as a single service, or as a group of services.</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/ecs/\">Learn more about Amazon Container Service (Amazon ECS) </a></p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/lambda/\">Learn more about AWS Lambda </a><br>&nbsp;</p><hr><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_infra-as-code.b06da7712aef8acebd6567fdc0038838baac1339.png\" alt=\"Infrastructure as Code\"></figure><h3 style=\"margin-left:auto;\">Infrastructure as Code</h3><p style=\"margin-left:auto;\">Infrastructure as code is a practice in which infrastructure is provisioned and managed using code and software development techniques, such as version control and continuous integration. The clouds API-driven model enables developers and system administrators to interact with infrastructure programmatically, and at scale, instead of needing to manually set up and configure resources. Thus, engineers can interface with infrastructure using code-based tools and treat infrastructure in a manner similar to how they treat application code. Because they are defined by code, infrastructure and servers can quickly be deployed using standardized patterns, updated with the latest patches and versions, or duplicated in repeatable ways.</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/cloudformation/\">Learn to manage your infrastructure as code with AWS CloudFormation </a></p><h4 style=\"margin-left:auto;\">Configuration Management</h4><p style=\"margin-left:auto;\">Developers and system administrators use code to automate operating system and host configuration, operational tasks, and more. The use of code makes configuration changes repeatable and standardized. It frees developers and systems administrators from manually configuring operating systems, system applications, or server software.</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/ec2/systems-manager/\">Learn how you can configure and manage Amazon EC2 and on-premises systems with Amazon EC2 Systems Manager </a></p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/opsworks/\">Learn to use configuration management with AWS OpsWorks </a><br>&nbsp;</p><h4 style=\"margin-left:auto;\">Policy as Code</h4><p style=\"margin-left:auto;\">With infrastructure and its configuration codified with the cloud, organizations can monitor and enforce compliance dynamically and at scale. Infrastructure that is described by code can thus be tracked, validated, and reconfigured in an automated way. This makes it easier for organizations to govern changes over resources and ensure that security measures are properly enforced in a distributed manner (e.g. information security or compliance with PCI-DSS or HIPAA). This allows teams within an organization to move at higher velocity since non-compliant resources can be automatically flagged for further investigation or even automatically brought back into compliance.</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/config/\">Learn how you can use AWS Config and Config Rules to monitor and enforce compliance for your infrastructure </a>&nbsp;</p><hr><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_monitor-logging.0951102aacf44686a26ed62b4498eca6387b38dd.png\" alt=\"Monitoring and Logging\"></figure><h3 style=\"margin-left:auto;\">Monitoring and Logging</h3><p style=\"margin-left:auto;\">Organizations monitor metrics and logs to see how application and infrastructure performance impacts the experience of their products end user. By capturing, categorizing, and then analyzing data and logs generated by applications and infrastructure, organizations understand how changes or updates impact users, shedding insights into the root causes of problems or unexpected changes. Active monitoring becomes increasingly important as services must be available 24/7 and as application and infrastructure update frequency increases. Creating alerts or performing real-time analysis of this data also helps organizations more proactively monitor their services.</p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/cloudwatch/\">Learn how you can use Amazon CloudWatch to monitor your infrastructure metrics and logs </a></p><p style=\"margin-left:auto;\"><a href=\"https://aws.amazon.com/cloudtrail/\">Learn how you can use AWS CloudTrail to record and log AWS API calls </a><br>&nbsp;</p><hr><figure class=\"image image_resized\" style=\"width:1200px;\"><img src=\"https://d1.awsstatic.com/Developer%20Marketing/DevOps/DevOps-What-is_communication-collaboration.299a6b746fc2b80bb323f102e6d9e4d2f6306665.png\" alt=\"Communication and Collaboration\"></figure><h3 style=\"margin-left:auto;\">Communication and Collaboration</h3><p style=\"margin-left:auto;\">Increased communication and collaboration in an organization is one of the key cultural aspects of DevOps. The use of DevOps tooling and automation of the software delivery process establishes collaboration by physically bringing together the workflows and responsibilities of development and operations. Building on top of that, these teams set strong cultural norms around information sharing and facilitating communication through the use of chat applications, issue or project tracking systems, and wikis. This helps speed up communication across developers, operations, and even other teams like marketing or sales, allowing all parts of the organization to align more closely on goals and projects.</p>',_binary '\0',NULL,'','NORMAL','user12','2021-08-27 14:42:27.503','user12','2021-08-27 14:43:10.688',_binary ''),(1132,731,1,'Top 10 Skills That Make A Perfect DevOps Engineer','DevOps everywhere!','<h2 style=\"margin-left:0px;\"><strong>Top 10 Skills That Make A Perfect DevOps Engineer</strong></h2><p style=\"margin-left:0px;\">By Veritis</p><p style=\"margin-left:0px;\">&nbsp;</p><figure class=\"image\"><img src=\"https://www.veritis.com/wp-content/uploads/2020/03/top-10-skills-that-make-a-%E2%80%98perfect%E2%80%99-devops-engineer.jpg\" alt=\"Top 10 Skills That Make A Perfect DevOps Engineer\" srcset=\"https://veritis.com/wp-content/uploads/2020/03/top-10-skills-that-make-a-perfect-devops-engineer.jpg 800w, https://veritis.com/wp-content/uploads/2020/03/top-10-skills-that-make-a-perfect-devops-engineer-300x169.jpg 300w, https://veritis.com/wp-content/uploads/2020/03/top-10-skills-that-make-a-perfect-devops-engineer-768x432.jpg 768w, https://veritis.com/wp-content/uploads/2020/03/top-10-skills-that-make-a-perfect-devops-engineer-600x338.jpg 600w\" sizes=\"100vw\" width=\"800\"></figure><p style=\"margin-left:0px;\">DevOps everywhere!</p><p style=\"margin-left:0px;\">More than a technology solution, DevOps emerged as the common buzz word for the IT industry, especially the US IT market.</p><p style=\"margin-left:0px;\">What makes it so popular is its ability to drive consistent, secure and faster software delivery resulting in reduced time-to-market and improved end-user satisfaction.</p><p style=\"margin-left:0px;\">Given these benefits, DevOps has become the need of the hour for many leading enterprises.</p><p style=\"margin-left:0px;\">Even the small and medium companies are also laying their paths into DevOps.</p><p style=\"margin-left:0px;\">All they need is DevOps engineers and DevOps expertise!</p><p style=\"margin-left:0px;\">Do you know? <a href=\"https://www.veritis.com/solutions/devops/\">DevOps</a> is one of the top most-wanted technology roles that the US IT industry is looking for!</p><p style=\"margin-left:0px;\">Want to tap this highly-paid opportunity? Then you would need to excel in the following 10 areas that make the powerful DevOps skillset.</p><h2 style=\"margin-left:0px;\"><strong>Top 10 Skills for DevOps Engineer Professionals</strong></h2><figure class=\"image\"><img src=\"https://www.veritis.com/wp-content/uploads/2020/03/top-10-areas-that-make-the-powerful-devops-skillset.png\" alt=\"Top 10 Areas That Make the Powerful DevOps Skillset\" srcset=\"https://veritis.com/wp-content/uploads/2020/03/top-10-areas-that-make-the-powerful-devops-skillset.png 800w, https://veritis.com/wp-content/uploads/2020/03/top-10-areas-that-make-the-powerful-devops-skillset-300x200.png 300w, https://veritis.com/wp-content/uploads/2020/03/top-10-areas-that-make-the-powerful-devops-skillset-768x513.png 768w, https://veritis.com/wp-content/uploads/2020/03/top-10-areas-that-make-the-powerful-devops-skillset-600x401.png 600w\" sizes=\"100vw\" width=\"800\"></figure><h3 style=\"margin-left:0px;\"><strong>1) Communication and Collaboration</strong></h3><p style=\"margin-left:0px;\">Given its basic nature, communication and collaboration are very crucial to succeed in DevOps competition. These two are very important to breaking down the siloes between Dev and Ops teams, aligning teams goals to business objectives and implement DevOps culture cross-functionally.</p><h3 style=\"margin-left:0px;\"><strong>2) Soft Skills and Noble Thought</strong></h3><p style=\"margin-left:0px;\">Its not enough if you are just good at coding and automation. DevOps needs a different you, who is also good at soft skills, self-motivation, flexibility and learning. DevOps professionals should be the doers as well as listeners.</p><p style=\"margin-left:0px;\">They should be clear about the fact that <a href=\"https://www.veritis.com/solutions/devops/\">DevOps transformation</a> involves stakeholder discussions, awareness about business goals, assessment and identification of improvement areas, all driven by collaboration.</p><h3 style=\"margin-left:0px;\"><strong>3) Understanding of Relevant Tools</strong></h3><p style=\"margin-left:0px;\">DevOps success purely depends on the <a href=\"https://www.veritis.com/solutions/devops/made-easier-with-devops-tools/\">toolset</a> it involves during different phases of its implementation. Its hard to even count the number of tools that DevOps brought in. But the significance in making DevOps success is something to be discussed in detail.</p><h3 style=\"margin-left:0px;\"><strong>4) Security Skills</strong></h3><p style=\"margin-left:0px;\">The rate of risks often matches with the speed of deployment that DevOps facilitates. Given this constraint, security at the end or as a separate process in the traditional method might not work. This is where DevSecOps proves to be an advantage integrating security with SDLC right from the start.</p><p style=\"margin-left:0px;\">So, <a href=\"https://www.veritis.com/solutions/devops/devsecops-services/\">DevSecOps</a> skillset will definitely be an added advantage to success as a DevOps professional.</p><h3 style=\"margin-left:0px;\"><strong>5) Automation Skills</strong></h3><p style=\"margin-left:0px;\">Being called as a DevOps engineer will require a good command over automation, the heart of DevOps process. A DevOps engineer should be capable of automating the entire DevOps pipeline, including CI/CD cycles, app performance monitoring, infrastructure and configurations, among others.</p><p style=\"margin-left:0px;\">DevOps automation skillset is closely linked to ability in knowledge about <a href=\"https://www.veritis.com/solutions/devops/made-easier-with-devops-tools/\">DevOps toolset</a>, coding and scripting.</p><h3 style=\"margin-left:0px;\"><strong>6) Coding and Scripting</strong></h3><p style=\"margin-left:0px;\">Coding and scripting are two important skillset that DevOps engineer should possess. Python, Ruby, Python, Java, Javascript, PHP, Bash, Shell and Node.js are among the most recommended programming/scripting languages.</p><h3 style=\"margin-left:0px;\"><strong>7) Cloud Skills</strong></h3><p style=\"margin-left:0px;\">Cloud and DevOps are always together. The efficiency of one is directly dependent on and influenced by the other. While DevOps methodology drives a process, cloud enables that process by providing it with necessary platform to perform test, deploy and release code.</p><p style=\"margin-left:0px;\">Cloud enables <a href=\"https://www.veritis.com/solutions/devops/automation-services/\">DevOps automation</a> with required CI/CD toolset and also facilitates a resource monitoring mechanism.</p><h3 style=\"margin-left:0px;\"><strong>8) Testing Skills</strong></h3><p style=\"margin-left:0px;\">Testing stands crucial to DevOps success. DevOps automation pipeline will need tests that run well without fail. This is important for the success of continuous testing, where the automated tests are executed.</p><blockquote><p style=\"margin-left:0px;\">Automated test cases make the process faster and ensures quality delivery to the end-user.</p></blockquote><h3 style=\"margin-left:0px;\"><strong>9) Customer-Focused Approach</strong></h3><p style=\"margin-left:0px;\"><a href=\"https://www.veritis.com/blog/6-ways-devops-promises-100-customer-satisfaction/\">Customer satisfaction</a> is the end goal of any successful DevOps process. Given this factor, DevOps professionals should ensure every function they perform should be in line with business objectives and delivery value to the end-user.</p><p style=\"margin-left:0px;\">In the process, they will need to collaborate with stakeholders such as developers, testers, project managers and organizations thought leadership, towards a common goal.</p><h3 style=\"margin-left:0px;\"><strong>10) Proactiveness</strong></h3><p style=\"margin-left:0px;\">Overall, DevOps engineers/pros will need the proactiveness and passion towards work, which directly reflects in performance and productivity. Moreover, staying updated with relevant technologies, new tools, and more are part of your process.</p><blockquote><p style=\"margin-left:0px;\">Passion and Proactiveness make you a successful DevOps professional.</p></blockquote><p style=\"margin-left:0px;\"><strong>In Conclusion</strong><br>DevOps is merely a culture more than a technology solution. More you understand the more beneficiary it will be. But to succeed in DevOps journey, as a professional or a company or a service provider, all you need is an openness to change and flexibility in operations, along with the combination of hard and soft skills.</p><p style=\"margin-left:0px;\">Wait no more! Find your potential DevOps opportunity!</p>',_binary '\0',NULL,'images/download163007546494716365.png','NORMAL','user12','2021-08-27 14:45:30.219','user12','2021-08-27 14:45:30.219',_binary '\0'),(1133,124,1,'Bai viet moi','','<p>ok&nbsp;</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-27 14:48:41.523','user917','2021-08-28 00:52:53.328',_binary ''),(1134,1,1,'How to Create a Modal in React','','<p style=\"margin-left:0;\">One of the most used components in React is undoubtedly modals because they can be used in different contexts, from messages to user input.</p><p style=\"margin-left:0;\">Like many other components in React, a dependency can be installed that helps in this process, however we always end up being limited in several ways and one of them is styling.</p><p style=\"margin-left:0;\">For this reason I had the idea to create in this article, we are going to use the knowledge we already know, from css, props and hooks.</p><h2 style=\"margin-left:0;\">Let\'s code</h2><p style=\"margin-left:0;\">Today the only thing we are going to install is an icon library to make it easier to use (however the same works if you use webfonts):<br>&nbsp;</p><pre><code class=\"language-plaintext\">npm install react-icons\n</code></pre><p style=\"margin-left:0;\">&nbsp;</p><p style=\"margin-left:0;\">Now we can immediately start working on our Modal.jsx. But first let\'s talk about CSS.</p><p style=\"margin-left:0;\">One of the classes we\'re going to have is called .darkBG that\'s because once the modal is open I\'ll add a background color to slightly hide all the other components that are on the page. This is to focus the user\'s attention only on the modal.</p><p style=\"margin-left:0;\">Then our component will be divided into three areas, the first one will be the header, where you can put the modal title. The second part will be the content, here you can put the message you want.</p><p style=\"margin-left:0;\">The third and last part will be the actions that can be performed in the modal, that is, cancel the modal in order to close it and another action (save, update, delete, etc).</p><p style=\"margin-left:0;\">Now that we have a few notions in mind, you can copy this same css (you can play freely with it to customize your modal):</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-27 14:54:40.080','user','2021-08-27 14:54:40.080',_binary '\0'),(1135,124,1,'Chao cac ban','','<p>ok cha</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-27 15:42:13.574','user917','2021-08-28 00:52:40.513',_binary ''),(1136,124,1,'chao','','<p>hi</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-27 15:43:59.507','user917','2021-08-28 00:52:35.398',_binary ''),(1137,124,1,'hello','','<p>Hi</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-27 15:44:30.354','user917','2021-08-28 00:52:25.199',_binary ''),(1138,124,1,'cho 2','','<p>hi</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-27 15:46:09.738','user917','2021-08-28 00:52:14.661',_binary ''),(1140,1,1,'chc chua','','<p>test</p>',_binary '\0',NULL,'','NORMAL','user','2021-08-27 16:11:15.455','user','2021-08-28 00:49:14.225',_binary ''),(1141,124,1,'Cho c','','<p>T y :v</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-28 01:07:51.016','user917','2021-08-28 01:10:45.458',_binary ''),(1142,124,1,'Hello','','<p>cho</p>',_binary '\0',NULL,'','NORMAL','user917','2021-08-28 01:08:38.523','user917','2021-08-28 01:10:40.674',_binary ''),(1143,1034,1,'Bai viet moi','Bai viet moi','<p>klsajdflajks</p><p>dfalsdf</p><p><strong>alosdfoasdfo</strong></p><p><strong>alkdsflhjk</strong></p><figure class=\"image\"><img src=\"\"></figure><figure class=\"image\"><img src=\"\"></figure><p>&nbsp;</p>',_binary '\0',NULL,'','NORMAL','ninhthuanabc123','2021-08-28 01:26:32.666','ninhthuanabc123','2021-08-28 01:26:32.666',_binary '\0'),(1144,977,1,'bai viet moi','bai viet moi','<p>bai viet moi</p>',_binary '\0',NULL,'','NORMAL','user2','2021-08-28 01:31:20.668','user2','2021-08-28 01:31:20.668',_binary '\0');
